  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Moosehorn NWR
  outlines Refuge accomplishments from August through October of 1940. The report
  begins by summarizing the weather conditions during this period. Wildlife- including
  migratory birds, upland game birds, and big game animals- is also covered. The Refuge
  development and maintenance section discusses physical developments. The public
  relations section of the report describes recreational uses and law enforcement.\",\n\t\"owner_org\":
